import Jumbotron from './Components/Jumbotron'
import jumboData from './fixtures/jumbo.json'

function App() {
  return (
    <Jumbotron.Container>
      {jumboData.map((item) => (
        <Jumbotron key={item.id} direction={item.direction}>

        </Jumbotron>
      ))}
    </Jumbotron.Container>
  )
}

export default App;
